import"./chunk-2R6CW7ES.js";var o="Cree archivos de Excel usando OpenXML SAX con estilos. Este paquete es especialmente \xFAtil cuando se intenta generar archivos con varios miles de filas.",r="La idea detr\xE1s de este paquete facilitar el uso de un subconjunto de la funcionalidad de <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml'>DocumentFormat.OpenXml</a> apuntando a generar archivos Excel de gran tama\xF1o lo m\xE1s r\xE1pido possible mediante la utilizaci\xF3n del m\xE9todo SAX.",n="Al mismo tiempo, esta librer\xEDa deber\xEDa impedir la creaci\xF3n de un archivo inv\xE1lido (un archivo que no emite errores al momento de su creaci\xF3n, pero que no se puede abrir). Debido a que una de las razones m\xE1s frecuentes de la creaci\xF3n de archivos corruptos cuando se usa el m\xE9todo SAX es la ejecuci\xF3n de instrucciones en el orden incorrecto (por ejemplo, intentar crear una celda fuera de una hoja), esta librer\xEDa deber\xEDa impedirlo y lanzar una excepci\xF3n.",i={p1:"La Version 2.x de este paquete depende de la versi\xF3n <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml/2.20.0' rel='noopener noreferrer nofollow'>2.20 de DocumentFormat.OpenXml</a>. A partir de la versi\xF3n 3, BigExcelCreator depende de la versi\xF3n <a href='https://www.nuget.org/packages/DocumentFormat.OpenXml' rel='noopener noreferrer nofollow'>3 de DocumentFormat.OpenXml</a>.",p2:"Si ya est\xE1 utilizando DocumentFormat.OpenXml v2, ya sea directamente o como referencia transitiva, y por alg\xFAn motivo no puede actualizar (ej.: por ser dependencia de otro paquete), use <a href='{{lastVersion2}}' rel='noopener noreferrer nofollow'>BigExcelCreator v2</a>",p3:"Caso contrario, se recomienda que utilice la \xFAltima versi\xF3n disponible."},t={p1:o,p2:r,p3:n,note:i};export{t as default,i as note,o as p1,r as p2,n as p3};
